  [],\n\t\"revision_timestamp\": \"2016-08-04T08:18:28.009219\",\n\t\"name\": \"annual-narrative-report-2003-koyukuk-nowitna-national-wildlife-refuge-complex\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Koyukuk/Nowitna
  National Wildlife Refuge Complex outlines Refuge accomplishments during the 2003
  calendar year. The report begins with a summary of the year's highlights and weather
  conditions. The report includes a planning section which discusses compliance with
  environmental and cultural resource mandates and research and investigations. Refuge
  administration is outlined; information about personnel, volunteer programs, funding,
  safety, and technical assistance is given. Habitat management is also covered; subjects
  include wetlands, forests, fire management, and wilderness areas. The wildlife section
  of the report discusses wildlife diversity, endangered and threatened species, waterfowl,
  marsh birds and waterbirds, shorebirds, raptors, game mammals, fisheries resources,
  and marking and bird banding. The public uses of the Refuge described in this report
  include outdoor classrooms, interpretive programs, hunting, fishing, trapping, and
  law enforcement. The equipment and facilities section of the report provides information
  about new construction, rehabilitation, major maintenance, equipment replacement,
  communication systems, and computer systems. Cooperative programs are provided at
  the end.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
